package abi_test

import (
	"context"
	"encoding/base64"
	"encoding/json"
	"math/big"
	"testing"

	"github.com/stretchr/testify/require"

	"github.com/xssnick/tonutils-go/address"
	"github.com/xssnick/tonutils-go/ton/nft"
	"github.com/xssnick/tonutils-go/tvm/cell"

	"github.com/tonindexer/anton/abi"
)

var configCell *cell.Cell // mainnet blockchain config

func init() {
	// mainnet blockchain config
	config, err := base64.StdEncoding.DecodeString("")
	if err != nil {
		panic(err)
	}
	configCell, err = cell.FromBOC(config)
	if err != nil {
		panic(err)
	}
}

func TestHasGetMethod(t *testing.T) {
	// https://ton.cx/address/EQAiZupbLhdE7UWQgnTirCbIJRg6yxfmkvTDjxsFh33Cu5rM
	codeBOC := mustBase64(t, "")

	code, err := cell.FromBOC(codeBOC)
	require.Nil(t, err)

	h := abi.MethodNameHash("get_nft_data")
	require.Equal(t, int32(0x18fcf), h)
	require.True(t, abi.HasGetMethod(code, "get_nft_data"))
}

func TestGetMethodHashes(t *testing.T) {
	// https://ton.cx/address/EQAiZupbLhdE7UWQgnTirCbIJRg6yxfmkvTDjxsFh33Cu5rM
	codeBOC := mustBase64(t, "")

	code, err := cell.FromBOC(codeBOC)
	require.Nil(t, err)

	hashes, err := abi.GetMethodHashes(code)
	require.Nil(t, err)
	require.Equal(t, []int32{0x18fcf}, hashes)
}

func TestEmulator_RunGetMethod(t *testing.T) {
	// query nft collection get_nft_address_by_index
	collection := address.MustParseAddr("EQBMy6CNgBk8PrT5LNjPELxCX_LXBaVSqtbzRToUHlG3t-fg")

	collectionCode, err := base64.StdEncoding.DecodeString("")
	require.Nil(t, err)
	collectionData, err := base64.StdEncoding.DecodeString("")
	require.Nil(t, err)

	collectionCodeCell, err := cell.FromBOCMultiRoot(collectionCode)
	require.Nil(t, err)
	collectionDataCell, err := cell.FromBOCMultiRoot(collectionData)
	require.Nil(t, err)

	eCollection, err := abi.NewEmulator(collection, collectionCodeCell[0], collectionDataCell[0], configCell)
	require.Nil(t, err)

	ret, err := eCollection.RunGetMethod(context.Background(), "get_nft_address_by_index",
		[]abi.VmValue{
			{
				VmValueDesc: abi.VmValueDesc{
					Name:      "index",
					StackType: "int",
				},
				Payload: big.NewInt(100),
			},
		},
		[]abi.VmValueDesc{
			{
				Name:      "address",
				StackType: "slice",
				Format:    "addr",
			},
		},
	)
	require.Nil(t, err)
	require.Equal(t, 1, len(ret))
	item, ok := ret[0].Payload.(*address.Address)
	require.True(t, ok)
	require.Equal(t, "EQAQKmY9GTsEb6lREv-vxjT5sVHJyli40xGEYP3tKZSDuTBj", item.String())

	// query nft item get_nft_data
	itemCode, err := base64.StdEncoding.DecodeString("")
	require.Nil(t, err)
	itemData, err := base64.StdEncoding.DecodeString("te6cckEBAgEAWAABlQAAAAAAAABkgAmZdBGwAyeH1p8lmxniF4hL/lrgtKpVWt5op0KDyjb28AIihaT5me2lhAhFtxowTSuLb3JY8S1sv5rLvgAnLsoWVgEAEDEwMC5qc29u7rJBww==")
	require.Nil(t, err)

	itemCodeCell, err := cell.FromBOCMultiRoot(itemCode)
	require.Nil(t, err)
	itemDataCell, err := cell.FromBOCMultiRoot(itemData)
	require.Nil(t, err)

	eItem, err := abi.NewEmulator(item, itemCodeCell[0], itemDataCell[0], configCell)
	require.Nil(t, err)

	ret, err = eItem.RunGetMethod(context.Background(), "get_nft_data", nil,
		[]abi.VmValueDesc{
			{
				Name:      "init",
				StackType: "int",
				Format:    "bool",
			}, {
				Name:      "index",
				StackType: "int",
			}, {
				Name:      "collection_address",
				StackType: "slice",
				Format:    "addr",
			}, {
				Name:      "owner_address",
				StackType: "slice",
				Format:    "addr",
			}, {
				Name:      "individual_content",
				StackType: "cell",
			},
		},
	)
	require.Nil(t, err)
	require.Equal(t, 5, len(ret))
	collectionGot, ok := ret[2].Payload.(*address.Address)
	require.True(t, ok)
	require.Equal(t, collection.String(), collectionGot.String())
	indContent, ok := ret[4].Payload.(*cell.Cell)
	require.True(t, ok)
	require.NotNil(t, indContent)
	require.Equal(t, "te6cckEBAQEACgAAEDEwMC5qc29ue9bV9g==", base64.StdEncoding.EncodeToString(indContent.ToBOC()))

	// query nft collection get_nft_content
	ret, err = eCollection.RunGetMethod(context.Background(), "get_nft_content",
		[]abi.VmValue{
			{
				VmValueDesc: abi.VmValueDesc{
					Name:      "index",
					StackType: "int",
				},
				Payload: big.NewInt(100),
			}, {
				VmValueDesc: abi.VmValueDesc{
					Name:      "individual_content",
					StackType: "cell",
				},
				Payload: indContent,
			},
		},
		[]abi.VmValueDesc{
			{
				Name:      "full_content",
				StackType: "cell",
				Format:    "content",
			},
		},
	)
	require.Nil(t, err)
	require.Equal(t, 1, len(ret))
	contentOffChain, ok := ret[0].Payload.(*nft.ContentOffchain)
	require.True(t, ok)
	require.Equal(t, "https://loton.fun/nft/100.json", contentOffChain.URI)
}

func TestEmulator_RunGetMethod_ReturnsDefinition(t *testing.T) {
	defJ := []byte(`{
  "native_asset": [
    {
      "name": "native_asset",
      "tlb_type": "$0000",
      "format": "tag"
    }
  ],
  "jetton_asset": [
    {
      "name": "jetton_asset",
      "tlb_type": "$0001",
      "format": "tag"
    },
    {
      "name": "workchain_id",
      "tlb_type": "## 8",
      "format": "int8"
    },
    {
      "name": "jetton_address",
      "tlb_type": "## 256"
    }
  ],
  "asset_union": [
    {
      "name": "asset",
      "tlb_type": ".",
      "struct_fields": [
        {
          "name": "value",
          "tlb_type": "[native_asset,jetton_asset]"
        }
      ]
    }
  ]
}`)

	var def map[abi.TLBType]abi.TLBFieldsDesc

	err := json.Unmarshal(defJ, &def)
	require.Nil(t, err)

	err = abi.RegisterDefinitions(def)
	require.Nil(t, err)

	vault := address.MustParseAddr("EQAf4BMoiqPf0U2ADoNiEatTemiw3UXkt5H90aQpeSKC2l7f")

	vaultCode, err := base64.StdEncoding.DecodeString("")
	require.Nil(t, err)
	vaultData, err := base64.StdEncoding.DecodeString("")
	require.Nil(t, err)

	vaultCodeCell, err := cell.FromBOCMultiRoot(vaultCode)
	require.Nil(t, err)
	vaultDataCell, err := cell.FromBOCMultiRoot(vaultData)
	require.Nil(t, err)

	eVault, err := abi.NewEmulator(vault, vaultCodeCell[0], vaultDataCell[0], configCell)
	require.Nil(t, err)

	ret, err := eVault.RunGetMethod(context.Background(), "get_asset", nil, []abi.VmValueDesc{
		{
			Name:      "asset",
			StackType: "slice",
			Format:    "asset_union",
		},
	})
	require.Nil(t, err)

	j, err := json.Marshal(ret)
	require.Nil(t, err)
	require.Equal(t, `[{"name":"asset","stack_type":"slice","format":"asset_union","payload":{"asset":{"value":{"jetton_asset":{},"workchain_id":0,"jetton_address":45985353862647206060987594732861817093328871106941773337270673759241903247880}}}}]`, string(j))
}
